def add_rows(curr_row, row):
    result = []
    for val_a, val_b in zip(curr_row, row):
        if isinstance(val_a, (int, float)) and isinstance(val_b, (int, float)):
            result.append(val_a + val_b)
        else:
            result.append(val_a if val_a else val_b)
    return result


def add_same_row(curr_row, out_rows):
    found = False
    for idx, row in enumerate(out_rows):
        if curr_row[0] == row[0] and curr_row[1] == row[1] and curr_row[3] == row[3] and curr_row[2] == row[2]:
            found = True
            new_row = add_rows(curr_row, row)
            out_rows[idx] = new_row
            break
    if not found:
        out_rows.append(curr_row)
    return out_rows


def convert_to_single(temp_rows):
    out_rows = []
    for idx, curr_row in enumerate(temp_rows):
        if idx == 0:
            out_rows.append(curr_row)
        else:
            out_rows = add_same_row(curr_row, out_rows)
    return out_rows


